import React from 'react';
import { useState, useEffect } from 'react';
// import { MenuItems } from './MenuItems';
import './Navbar.css';
import { NavLink, Redirect } from 'react-router-dom';
import { Link } from 'react-router-dom';





const Navbar = () => {
    //using useEffect to get the token status
    const [loggedIn, setLoggedIn] = useState(false);
    const tokenStatus = () => {
        let response = localStorage.getItem('token');
        console.log(response);
        if (response !== null) {
            setLoggedIn(true);
        }
    };

    useEffect(() => {
        tokenStatus();
    }, []);
    const onClickSellcar = () => {
        console.log("clicked ");
        if (loggedIn) {
            console.log("true");
            //redirect to sellcar page without using redirect
            return <Redirect to="/sellcar" />
            // history.push('/sellcar');
        } else {
            console.log("false");
            return <Redirect to='/login' />
        }
    }

    const token = localStorage.getItem('token');
    if (token) {
        console.log('token present');
        console.log(token);
    } else {
        const token = false;
        console.log('token absent');
        console.log(token);
    }

    const logout = () => {
        localStorage.removeItem('token');
        window.location.reload('/');
    }


    //on click navlink button check token if present redirect to sellcar else login



    return (
        <>
            <input type="checkbox" id="check" />
            <nav >
                <NavLink to="/" className="icon"><b style={{ color: 'red' }}>S</b>ell<b style={{ color: 'red' }}>C</b>ar</NavLink>
                <div className="search_box">
                    <input type="search" placeholder="Search Car" />
                    <span className="fa fa-search"></span>
                </div>
                <ol>
                    <li><NavLink to="/sellcar">SellCar</NavLink></li>
                    <li><NavLink to={onClickSellcar}>SellCar</NavLink></li>
                    <li><Link onClick={(
                        loggedIn ? (
                            <Redirect to="/sellcar" />
                        ) : (
                            <Redirect to="/login" />))
                    } >SellCar</Link></li>
                    {/* <li><NavLink to="/login">Login</NavLink></li>  */}

                    {token ? <li><NavLink to="/" onClick={logout}>Logout</NavLink></li> : <li><NavLink to="/login" >Login</NavLink></li>}


                </ol>
                <label for="check" className="bar">
                    <span className="fa fa-bars" id="bars"></span>
                    <span className="fa fa-times" id="times"></span>
                </label>
            </nav>
        </>
    )
}

export default Navbar;
